async function seedReverbProducts() {
  console.log('🌱 Seeding Reverb products...');
  
  // Get or create categories
  let woodwindsCategory = await prisma.category.findFirst({
    where: { slug: 'woodwinds' }
  });
  
  if (!woodwindsCategory) {
    woodwindsCategory = await prisma.category.create({
      data: {
        name: 'Woodwinds',
        slug: 'woodwinds',
        description: 'Professional woodwind instruments'
      }
    });
  }
  
  // Clear existing products (optional - comment out to keep existing)
  // await prisma.product.deleteMany({});
  
  for (const product of reverbProducts) {
    try {
      await prisma.product.create({
        data: {
          name: product.name,
          slug: product.slug,
          brand: product.brand,
          price: product.price,
          retailPrice: product.retailPrice,
          description: product.description,
          category: product.category,
          subcategory: product.subcategory,
          images: product.images,
          inStock: product.inStock,
          stock: 1,
          badge: product.badge,
          rating: product.rating,
          reviewCount: product.reviewCount,
          sku: product.sku,
          specs: product.specs,
          included: product.included,
          categoryId: woodwindsCategory.id
        }
      });
      console.log(`  ✓ Created: ${product.name.substring(0, 50)}...`);
    } catch (error) {
      console.log(`  ✗ Error creating ${product.name}: ${error.message}`);
    }
  }
  
  console.log('\n✅ Seeding complete!');
}

seedReverbProducts()
  .catch(console.error)
  .finally(() => prisma.$disconnect());
